export default class Note extends Component {
  constructor(props) {
    super(props);
    this.state = { lists: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5000/list/")
      .then((response) => {
        this.setState({ lists: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  todoList() {
    return this.state.lists.map((listItem) => {
      return <Note note={listItem} />;
    });
  }

  render() {
    return (
      <div className="note">
        <h1>h1</h1>
        <p>Test P</p>
        <button>
          <DeleteIcon />
        </button>
      </div>
    );
  }
}

